import { useState } from "react";
import art from './images/art.png';
import biology from './images/biology.png';
import drama from './images/drama.png';
import englisg from './images/englisg.png';
import geography from './images/geography.png';
import history from './images/history.png';
import it from './images/it.png';
import maths from './images/maths.png';
import music from './images/music.png';
import science from './images/science.png';
import swimming from './images/swimming.png';

const Subjects = () => {

    const [subjects, setSubjects] = useState([
        {
            id: 1,
            name: 'Art',
            day: 'Monday',
            image: art
        },
        {
            id: 2,
            name: 'English',
            day: 'Tuesday',
            image: englisg
        },
        {
            id: 3,
            name: 'Maths',
            day:  'Wednesday',
            image: maths
        },
        {
            id: 4,
            name: 'Music',
            day: 'Wednesday',
            image: music
        },
        {
            id: 5,
            name: 'Biology',
            day: 'Friday',
            image: biology
        },
        {
            id: 6,
            name: 'Geography',
            day: 'Thursday',
            image: geography
        },
        {
            id: 7,
            name: 'History',
            day: 'Thursday',
            image: history
        },
        {   id: 8,
            name: 'IT',
            day: 'Monday',
            image: it
        },
        {
            id: 9,
            name: 'Science',
            day: 'Friday',
            image: science
        },
        {
            id: 10,
            name: 'Drama',
            day: 'Tuesday',
            image: drama
        },
        {
            id: 11,
            name: 'Swimming',
            day: 'Friday',
            image: swimming
        }

])
    return (
        <main>
            {
                subjects.map((subject) => (
                    <div>
                        <p>{subject.name}</p>
                        <img src={subject.image} alt={subject.name} />
                    </div>
                ))
            }
        </main>
    )
}

export default Subjects;
